import React, { useState } from "react";
import '../assets/styles/ProjectArchive.scss';
import { ProjectData } from '../data/projects'; // We will create this next

function ProjectArchive() {
  const [filter, setFilter] = useState('All');

  const categories = ['All', 'Data Science', 'Software Engineering', 'Game Dev'];

  const filteredProjects = filter === 'All' 
    ? ProjectData 
    : ProjectData.filter(p => p.category === filter);

  return (
    <div className="project-archive-container" id="projects">
      <h1>Project Archive</h1>

      <div className="filter-bar">
        {categories.map(cat => (
          <button 
            key={cat} 
            className={filter === cat ? 'active' : ''}
            onClick={() => setFilter(cat)}
          >
            {cat}
          </button>
        ))}
      </div>

      <div className="project-grid">
        {filteredProjects.map((project, index) => (
          <div className="project-card" key={index}>
            <div className="image-container">
              <img src={project.image} alt={project.title} />
              <div className="overlay">
                <a href={project.link} target="_blank" rel="noreferrer">View Live</a>
              </div>
            </div>
            <div className="card-content">
              <span className="category-tag">{project.category}</span>
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <div className="tech-tags">
                {project.tech.map(t => <span key={t}>#{t}</span>)}
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ProjectArchive;
